import ImageUpload from "./Image.Upload"; 

function App() {
  return (
    <div>
      <h1>Upload an Image</h1>
      <ImageUpload />
      <div className="border p-4 mt-4">
        <h2 className="text-lg font-semibold mb-2">Dish Information</h2>
        <input
          type="text"
          id="dishInput"
          placeholder="Enter dish name"
          className="border p-2 w-full mb-2"
        />
        <button
          onClick={() => {
            const event = new KeyboardEvent("keydown", { key: "Enter" });
            document.getElementById("dishInput").dispatchEvent(event);
          }}
          className="bg-blue-500 text-white px-4 py-2 rounded"
        >
          Search Dish
        </button> 
        <div className="mt-4">
          <p className="text-red-600">Results will appear here.</p>
        </div>
      </div>
    </div>
  );
}
// This is the main App component that includes the ImageUpload component and a section for dish information

export default App;
